import React, { Component } from 'react';
import './Obruc.css';

class Obruc extends Component {
  render() {
    return(
      <p>This is a placeholder for the text and illustrations for Obruč logo</p>
    );
  }
}

class Dubrovnik extends Component {
  render() {
    return(
      <p>This is a placeholder for the text and illustrations for Obruč logo</p>
    );
  }
}

export default Obruc;
